import React from 'react';

const UserData = ({ fullName, amount }) => {
  return (
    <div>
      <h1>User Data</h1>
      <p>Name: {fullName}</p>
      <p>Received Amount: {amount}</p>
    </div>
  );
};

export default UserData;
